export type StateName = (typeof states)[number];
export type StateData = {
	name: StateName;
	formattedName: string;
	svgCoords: string;
};

export const stateList: StateData[] = states.map((state) => ({
	name: state,
	formattedName: formattedNames.get(state)!,
	svgCoords: stateLines.get(state)!
}));

export const groupedStates = flatGroupBy(stateList, 'name');
